<script>
    import TreatmentTimeline from "../../components/TreatmentTimeline.vue";
    import axios from "axios"
    import swal from "sweetalert"
    export default {
        
        components: {
            TreatmentTimeline
        },
        created() {
            this.getSpecificPatient()
            this.getspecificTreatmentList()
            this.parseJwt(this.token)
        },
        data() {
            return {
                tooth:[],
                token: localStorage.getItem('token'),
                uid: '',
                teeth:'',
                disabled: 0,
                formIsValid: true,
                treatmentList: [],
                formData: {
                    user: '',
                    tooth: [],
                    isAll: false,
                    isBabyTooth: false,
                    patient: '',
                    patientName: '',
                    treatmentDone: '',
                    doctorName: '',
                    date: new Date().toJSON().slice(0, 10).replace(/-/g, '/'),
                },
                form: {},
                items: []
            }
        },
        methods: {
            parseJwt(token) {
                var base64Url = token.split('.')[1];
                var base64 = base64Url.replace(/-/g, '+').replace(/_/g, '/');
                var jsonPayload = decodeURIComponent(Buffer.from(base64, 'base64').toString().split('').map(function (
                c) {
                    return '%' + ('00' + c.charCodeAt(0).toString(16)).slice(-2);
                }).join(''));
                const payload = JSON.parse(jsonPayload);
                this.uid = payload.sub
                console.log(payload.sub);
            },

            isAll() {
                if (this.formData.isAll == "true") {
                    this.disabled = 1
                    this.teeth = ''
                } else {
                    this.disabled = 0
                }
            },

            isNumber(evt) {
                if (!/\d/.test(evt.key) && evt.key !== ',') {
                    return evt.preventDefault();
                } else {
                    return true;
                }
            },
             choosetooth(evt,toothNo) {
                this.teeth=''
                console.log(toothNo)
                console.log(evt.target)
                console.log(evt.target.classList)
            //     if (evt.target.classList.contains('red')){
            //       const index = this.tooth.indexOf(toothNo);
            //        if (index > -1) {
            //          this.tooth.splice(index, 1);
            //     }
                
            //     }else{
            //         this.tooth.push(toothNo)
            //         console.log(this.tooth)
                
            //     }
                 //evt.target.style.stroke="#ff0000"
                 evt.target.classList.toggle('red')
            //     this.tooth.forEach(i => {
            //         this.teeth=this.teeth+','+i
                    
            //     });
            //     // this.teeth=this.teeth+','+toothNo
            //     if (this.teeth[0] == ',') { 
            //         this.teeth=this.teeth.substring(1)
            //     }
                
            },


            async getSpecificPatient() {
                await axios.get('patients/' + this.$route.params.id, {
                        headers: {
                            "Authorization": `Bearer ${localStorage.getItem('token') }`
                        }
                    })
                    .then((response) => {
                        this.formData.patientName = response.data.result.name;
                    })
                    .catch((error) => {
                        console.log(error)
                    })
            },

            async createTreatment() {
                this.formIsValid = true;
                this.formData.patient = this.$route.params.id
                this.formData.user = this.uid
                this.formData.doctorName = 'Iktisad'
                this.formData.tooth = this.teeth.split(',');
                if (this.formData.treatmentDone === '') {
                    this.formIsValid = false;
                } else {
                    await axios.post('treatment-notes/create', this.formData, {
                            headers: {
                                "Authorization": `Bearer ${localStorage.getItem('token') }`
                            }
                        })
                        .then((response) => {
                            console.log(response)
                            swal({
                                title: "Success",
                                text: "Treatment Notecreated Successfully!",
                                icon: "success",
                                timer: 1000,
                                buttons: false
                            })
                            this.formData.treatmentDone = ""
                            this.teeth = ""
                            this.getspecificTreatmentList()
                        })
                        .catch((error) => {
                            console.log(error)
                        })

                }
            },

            async getspecificTreatmentList() {
                await axios.get('treatment-notes/' + this.$route.params.id + '/patient', {
                        headers: {
                            "Authorization": `Bearer ${localStorage.getItem('token') }`
                        }
                    })
                    .then((response) => {

                        this.treatmentList = response.data['result']

                        console.log(this.treatmentList)
                    })
                    .catch((error) => {
                        console.log(error);
                    })
            },
        }


    }
</script>

